import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faWhatsapp, faGithub } from '@fortawesome/free-brands-svg-icons';
import { faEnvelope, faHouse } from '@fortawesome/free-solid-svg-icons';
import '../Css/header.css';
import headerImg from '../Assets/img-header.png';



const Header = () => {

    const handleDownload = () => {
        const link = document.createElement('a');
        link.href = '/Assets/CV_MUHAMMAD_ALVIN_NEW.pdf'; // Ganti dengan path ke file PDF yang ingin didownload
        link.setAttribute('download', 'CV_MUHAMMAD_ALVIN.pdf'); // Nama file yang akan di-download
        document.body.appendChild(link);
        link.click();
        document.body.removeChild(link);
    };

  return (
    <div className="header">
        <Container>
            <Row className='align-items'>
                <Col>
                    <p className='fwb'>Halo, Perkenalkan Saya,</p>
                    <h1 className='fwb text-yellow'>MUHAMMAD ALVIN</h1>
                    <p className='fwb'>Junior Frontend Developer</p>
                    <button onClick={handleDownload} className='button-cv bg-yellow text-purple fwb'>
                        <p className='fwb pop'>Download CV</p>
                    </button>
                    <div className='info'>
                        <div className='icon'>
                            <FontAwesomeIcon icon={faWhatsapp} />
                        </div>
                            <p className='fwb'>0888-1404-833</p>
                    </div>
                    <div className='info'>
                        <div className='icon'>
                            <FontAwesomeIcon icon={faGithub} />
                        </div>
                        <p className='fwb'>mhmdalvin63</p>
                    </div>
                    <div className='info'>
                        <div className='icon'>
                            <FontAwesomeIcon icon={faEnvelope} />
                        </div>
                        <p className='fwb'>alvinwork635@gmail.com</p>
                    </div>
                    <div className='info'>
                        <div className='icon'>
                            <FontAwesomeIcon icon={faHouse} />
                        </div>
                        <p className='fwb'>Depok, Jawa Barat</p>
                    </div>  
                </Col>

                <Col>
                    <img className='headerImg' src={headerImg} alt="headerImg" />
                    {/* <p>haiiii</p> */}
                </Col>
            </Row>
        </Container>
    </div>
  );
}

export default Header;
